const initialState = {
    isOpenModal: false
}

export default (state: any = initialState, action: any) => {
    if (action.type === 'TOGGLE_MODAL') {
        state.isOpenModal = !state.isOpenModal;
    }

    console.log('toggle modal reducer', state)

    return state;
};
